import React from 'react';
import { Carousel as ResponsiveCarousel } from 'react-responsive-carousel'; // Rename import to avoid conflict
import { img } from './img/data'; // Ensure this path is correct
import "react-responsive-carousel/lib/styles/carousel.min.css";

function Carousel() {
    return (
        <div>
            <ResponsiveCarousel // Use the renamed import here
                autoPlay={true}
                infiniteLoop={true}
                showIndicators={false}
                showThumbs={false}
            >
                {
                    img.map((imageItemLink, index) => (
                        <img src={imageItemLink} alt={`Slide ${index}`} key={index} />
                    ))
                }
            </ResponsiveCarousel>
        </div>
    );
}

export default Carousel;
